import React from 'react';
import './App.scss';
import Sidebar from './components/sidebar/Sidebar';
import Container from './components/container/Container';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div className="app">
      <Sidebar></Sidebar>
      <Container></Container>
    </div>
  );
}

export default App;
